import React from 'react';

export class Charts extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
      1: [],
      2: [],
      3: [],
      4: []
    }
  }

  componentDidMount() {
    fetch("https://sheetdb.io/api/v1/hse3ttfafjgip")
      .then((response) => {
        return response.json()
      }).then((json) => {
        this.setState({data: json});
      });
  }

  organiseData() {
    let final = [];
    for (let i = 1; i < 5; i++) {
      let segments = this.state.data.filter(item => item.Week == i);
      this.setState({i: segments})
    }
  }

  renderData() {
    for (let i = 1; i < 5; i++) {
      this.state.i.map((row) => 
        <div key={row.Module}>
          <p>{row.Module}</p>
          <p>{row.Instructions}</p>
        </div>
      )
    }
  }

